  input: "TEXT\x1CC00111278\x1CTEXT.1\x1C\x1CF3XA\x1CPlease accept this amendment
    in response to the current RFAI received by the NRTL PAC. As requested, all changes
    have been made. On point 5, all entries were made on 10/17/08 and should not have
    appeared on the previous report. On Points 5 and 6, any negatives were due to
    incorrect data entry and should now be updated correctly on this report. On Point
    7, there has been numerous erroneous data entry mistakes which most likely caused
    this confusion. All of these entries have been corrected. On Point 9, we cannot
    find any payment of $11,936.66 in our data entry. On Point 14, we have updated
    data entry to reflect support of the candidate who replaced Rep. Renzi. On Point
    15, all of these should have been filed to reflect run-off activity and has since
    been amended. On Point 16, NRTL entered and paid the actual amounts at the time
    or prior to dissemination. On Point 17, we believe there is a misunderstanding
    based on billings received which covered more than one billing cycle at a time.
    For example, charges were received and reported, and an additional bill would
    result after the reporting. Any time this occurred, both payments had a common
    item number to indicate that it was a payment for which had been already reported.
    \  In reference to our best efforts practice, NRTL runs a query each week to capture
    all PAC gifts that aggregate to $200 and over in the calendar year. For all donors
    that equal or exceed that amount, we send a letter requesting employment/occupation
    information as required.. If we do not have any response to the 1st letter after
    a month, we send a second request.\x1C\n"
